export default function FeedbackReport() {
  return (
    <div>
      <div id="feedbackRpt">
        <iframe
          width={1140}
          height="541.25"
          src="https://app.powerbi.com/reportEmbed?reportId=3bc131c0-edcb-46d8-8f21-b3392a3658fb&autoAuth=true&ctid=84c31ca0-ac3b-4eae-ad11-519d80233e6f&config=eyJjbHVzdGVyVXJsIjoiaHR0cHM6Ly93YWJpLXdlc3QtdXMtcmVkaXJlY3QuYW5hbHlzaXMud2luZG93cy5uZXQvIn0%3D"
          frameBorder={0}
          allowFullScreen="true"
          title="feedbackRpt"
        />
      </div>
    </div>
  );
}
